import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="home">
      <ul className="navbar">
        <Link to="/activities">
          <li>Activities</li>
        </Link>
        <Link to="/stats">
          <li>Stats</li>
        </Link>
      </ul>
    </div>
  );
};

export default Home;
